select * from (select * from (select l_orderkey, sum(l_extendedprice*(1-l_discount)) as revenue, o_orderdate, o_shippriority
from (select * from lineitem where ((l_orderkey >= 1942309) AND (l_orderkey < 5680996)) OR ((l_orderkey >= 9296355) AND (l_orderkey < 11172832)) OR ((l_orderkey >= 14915840) AND (l_orderkey < 16607975)) OR ((l_orderkey >= 22259780) AND (l_orderkey < 24101414)) OR ((l_orderkey >= 46500129) AND (l_orderkey < 48470790)) OR ((l_orderkey >= 52554116) AND (l_orderkey < 54495366)) OR ((l_orderkey >= 58154343) AND (l_orderkey < 60000001)) ) ll,
(select * from orders where ((o_orderkey >= 1651200) AND (o_orderkey < 5584739)) OR ((o_orderkey >= 9169893) AND (o_orderkey < 10921285)) OR ((o_orderkey >= 14710887) AND (o_orderkey < 16654374)) OR ((o_orderkey >= 22383874) AND (o_orderkey < 24300448)) OR ((o_orderkey >= 44809991) AND (o_orderkey < 46850850)) OR ((o_orderkey >= 52488768) AND (o_orderkey < 54500966)) OR ((o_orderkey >= 58251399) AND (o_orderkey < 60000001)) ) oo,
(select * from customer where ((c_custkey >= 139617) AND (c_custkey < 184356)) OR ((c_custkey >= 280186) AND (c_custkey < 329218)) OR ((c_custkey >= 423351) AND (c_custkey < 517679)) OR ((c_custkey >= 610694) AND (c_custkey < 656970)) OR ((c_custkey >= 705706) AND (c_custkey < 842308)) OR ((c_custkey >= 1310610) AND (c_custkey < 1357306)) ) cc
where c_mktsegment = 'BUILDING' and c_custkey = o_custkey and l_orderkey = o_orderkey and o_orderdate < '1995-03-15' and l_shipdate > '1995-03-15' group by l_orderkey, o_orderdate, o_shippriority) l2 order by revenue desc, o_orderdate) l1 limit 10;
